```javascript
import React, { useState } from 'react';
import './Popup.css';

function Popup({ title, message }) {
  const [isOpen, setIsOpen] = useState(false);

  const handleClick = () => {
    setIsOpen(true);
  };

  const handleClose = () => {
    setIsOpen(false);
  };

  const handleKeydown = (e) => {
    if (e.key === 'Escape') {
      handleClose();
    }
  };

  return (
    <div className="popup">
      <div className="popup-overlay" onClick={handleClose} onKeyDown={handleKeydown} />
      <div className="popup-content">
        <h1>{title}</h1>
        <p>{message}</p>
      </div>
    </div>
  );
}

export default Popup;
```
